import React, { useEffect, useRef, useState } from "react";
import Hls from "hls.js";

export default function IPTVWebApp() {
  const videoRef = useRef(null);
  const [channels, setChannels] = useState([]);
  const [filtered, setFiltered] = useState([]);
  const [streamUrl, setStreamUrl] = useState("");
  const [search, setSearch] = useState("");
  const [favorites, setFavorites] = useState(() =>
    JSON.parse(localStorage.getItem("favorites") || "[]")
  );
  const [error, setError] = useState(null);

  // ===== PLAYER =====
  useEffect(() => {
    if (!streamUrl || !videoRef.current) return;
    const video = videoRef.current;
    let hls;

    if (Hls.isSupported()) {
      hls = new Hls({ lowLatencyMode: true });
      hls.loadSource(streamUrl);
      hls.attachMedia(video);
      hls.on(Hls.Events.ERROR, (_, d) => d.fatal && setError("Stream error"));
    } else if (video.canPlayType("application/vnd.apple.mpegurl")) {
      video.src = streamUrl;
    }
    return () => hls && hls.destroy();
  }, [streamUrl]);

  // ===== SEARCH =====
  useEffect(() => {
    setFiltered(
      channels.filter((c) =>
        c.name.toLowerCase().includes(search.toLowerCase())
      )
    );
  }, [search, channels]);

  // ===== FAVORITES =====
  const toggleFav = (ch) => {
    const updated = favorites.find((f) => f.url === ch.url)
      ? favorites.filter((f) => f.url !== ch.url)
      : [...favorites, ch];
    setFavorites(updated);
    localStorage.setItem("favorites", JSON.stringify(updated));
  };

  // ===== M3U =====
  const handleM3U = async (file) => {
    const text = await file.text();
    const lines = text.split("\n");
    const parsed = [];
    for (let i = 0; i < lines.length; i++) {
      if (lines[i].startsWith("#EXTINF")) {
        parsed.push({ name: lines[i].split(",").pop(), url: lines[i + 1] });
      }
    }
    setChannels(parsed);
  };

  return (
    <div className="min-h-screen bg-zinc-950 text-white grid grid-cols-12">
      <aside className="col-span-12 md:col-span-3 bg-zinc-900 p-4 space-y-3">
        <h1 className="text-xl font-bold">IPTV WEB APP</h1>

        <input
          type="file"
          accept=".m3u"
          onChange={(e) => handleM3U(e.target.files[0])}
        />

        <input
          placeholder="Search channel"
          className="w-full p-2 rounded text-black"
          value={search}
          onChange={(e) => setSearch(e.target.value)}
        />

        <div className="max-h-[60vh] overflow-y-auto space-y-1">
          {filtered.map((c, i) => (
            <div
              key={i}
              className="flex items-center justify-between bg-zinc-800 p-2 rounded"
            >
              <button onClick={() => setStreamUrl(c.url)}>{c.name}</button>
              <button onClick={() => toggleFav(c)}>⭐</button>
            </div>
          ))}
        </div>
      </aside>

      <main className="col-span-12 md:col-span-9 p-6">
        {error && <p className="text-red-400">{error}</p>}
        <video
          ref={videoRef}
          controls
          autoPlay
          className="w-full aspect-video rounded-2xl bg-black"
        />

        {favorites.length > 0 && (
          <div className="mt-4">
            <h2 className="font-semibold">⭐ Favorites</h2>
            <div className="flex flex-wrap gap-2 mt-2">
              {favorites.map((f, i) => (
                <button
                  key={i}
                  onClick={() => setStreamUrl(f.url)}
                  className="bg-zinc-800 px-3 py-1 rounded"
                >
                  {f.name}
                </button>
              ))}
            </div>
          </div>
        )}
      </main>
    </div>
  );
}
